wss.on("connection", (ws) => {
  console.log("新连接建立");
  let conunt = 0;
  // 每200毫秒向客户端发送一条消息
  const intervalId = setInterval(() => {
    if (ws.readyState === WebSocket.OPEN) {
      ws.send(s.data[conunt++ % s.data.length]);
    }
  }, 200);

  // 监听客户端发来的消息
  ws.on("message", (message) => {
    console.log(`接收到消息: ${message}`);
  });

  // 监听连接断开事件
  ws.on("close", () => {
    console.log("连接关闭");
    clearInterval(intervalId); // 清除定时器
  });
});

